import React, { Component } from "react";

import { Dashboard as DashboardLayout } from "layouts";

export default class QuizDashboard extends Component {
	render() {
		return (
			<DashboardLayout title="Quizes">
				<div> Quiz List </div>
			</DashboardLayout>
		);
	}
}
